import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import Sdata from './Sdata';
console.log(Sdata[0]);
// import Project1 from './Project1'
// import Project2 from './Project2'
// root
function ncard(val){
    return(
<Card imgsrc={val.imgsrc} text={val.text} title={val.title} link={val.link}/>
    );
}

ReactDOM.render(<>
<h1>List Off 5 Netflix Series</h1>
{Sdata.map(ncard)}
</>
,document.getElementById('root'));

